import logo from './logo.svg';
import './App.css';


function App() {
  return (
      <div className="App">
        <title>
          Gym Tracker Site
          </title>
          <header><h1>Gym Tracker</h1></header>

          <div>
            <button>
              Past Workouts
            </button>
            <button>
              Add a New Workout
            </button>
          </div>
      </div>

  );
}

export default App;
